    #drop-region {
      background: linear-gradient(109.03deg, #dfe1e2 -53.53%, #fdffff 138.3%);
      border-radius: 2px;
      box-shadow: -30px -30px 60px 0px #ffffff4d;
      box-shadow: 30px 30px 60px 0px #c9cbcd4d;
      width: 900px;
      height: 450px;
      padding: 20px;
      text-align: center;
      cursor: pointer;
      transition: 0.3s;
      margin: 0 auto;
      &:hover {
        box-shadow: 0 0 45px rgba(0, 0, 0, 0.1);
