          width: 100%;
          display: flex;
          justify-content: center;
          align-items: center;
          flex-wrap: wrap;
          .change-image{
            background: rgba(66, 133, 244, 0.2);
            border: 1px solid #4285F4;
            color: #4285f4;
            padding: 8px 16px;
            outline: none;
            box-shadow: none;
            cursor: pointer;
            border-radius: 20px;
            margin-right: 5px;
          }
          .remove-image{
            background: rgba(234, 67, 53, 0.2);
            border: 1px solid #EA4335;
            color: #EA4335;
            padding: 8px 16px;
            outline: none;
            box-shadow: none;
            cursor: pointer;
            border-radius: 20px;
            margin-left: 5px;
          }
          &:hover {
            background: rgba(0, 0, 0, .4);
            opacity: 1;
          }
        }
        .image-view {
          height: 410px;
          img {
            max-width: 100%;
            width: 100%;
            height: 100%;
            object-fit: cover;
          }
        }
      }
    }
    .action-buttons {
      text-align: center;
      margin-top: 25px;
      .get_palette {
        color: #ffffff;
        background-color: #4285f4;
        border: none;
        outline: none;
        box-shadow: none;
        border-radius: 20px;
        padding: 12px 30px;
        cursor: pointer;
      }
    }
  }
}
